    false,nt"url": null,nt"notes": "This report summarizes the results of a
    waterfowl breeding pair survey taken on Nowitna National Wildlife Refuge in 1988.
    The breeding pair survey was conducted 31 May - 1 June. A total of 706 ducks, including
    264indicated pairs was observed. Breeding populations of most waterfowl species
    on the refuge remained unchanged from 1987 levels. Survey methods, results, and
    management recommendations are discussed.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
